using Microsoft.AspNetCore.Builder;
using Microsoft.AspNetCore.Http;
using Microsoft.AspNetCore.Mvc;
using System;
using System.IO;
using System.Net.Http;
using System.Text;
using System.Text.Json;

var builder = WebApplication.CreateBuilder();
var app = builder.Build();

const string apiUrl = "https://api.openai.com/v1/chat/completions";
const string modelName = "gpt-4o-mini";
var apiKey = await File.ReadAllTextAsync(
    Path.Combine(Environment.GetFolderPath(Environment.SpecialFolder.UserProfile), "openai-key.txt"))
    .ConfigureAwait(false);

app.MapPost("/AskChatGPT", async ([FromBody] string query) =>
{
    try
    {
        if (string.IsNullOrWhiteSpace(apiKey))
            throw new Exception("API key is not configured.");

        var sb = new StringBuilder();

        using var client = new HttpClient();
        client.DefaultRequestHeaders.Add("Authorization", $"Bearer {apiKey}");

        var request = new ChatRequest(modelName, new Message[] {
            new Message("system", "You are a helpful assistant."),
            new Message("user", query),
        });

        var requestJson = JsonSerializer.Serialize(request);
        var content = new StringContent(requestJson, Encoding.UTF8, "application/json");
        var responseMessage = await client.PostAsync(apiUrl, content).ConfigureAwait(false);

        if (responseMessage.IsSuccessStatusCode)
        {
            var responseJson = await responseMessage.Content.ReadAsStringAsync().ConfigureAwait(false);
            var response = JsonSerializer.Deserialize<ChatResponse>(responseJson);

            foreach (var eachChoice in response.choices)
                sb.Append(eachChoice.message.content);

            var apiResponse = new HttpChatGPTResponse(true, sb.ToString(), null);
            return Results.Ok(apiResponse);
        }
        else
        {
            var failedReason = await responseMessage.Content.ReadAsStringAsync().ConfigureAwait(false);
            return Results.BadRequest(failedReason);
        }
    }
    catch (Exception ex)
    {
        return Results.Problem(ex.ToString());
    }
});

